package by.bsu.sorts.handler;

import by.bsu.sorts.reader.InfoReader;

import java.util.Arrays;
import java.util.Collections;

public class TestMenu {
    public static void testTimeTask1(){

        int R = 0, N = 0, M = 0;
        System.out.println("R - number of array");
        R = new InfoReader().oneIntRead(System.in);

        System.out.println("N - size of array");
        N = new InfoReader().oneIntRead(System.in);

        System.out.println("M - number of Random");
        M = new InfoReader().oneIntRead(System.in);

        int[][] arr = new int[R][N];

        long tmp = arr.length;

        new InfoReader().inputRandomToArray(arr, M);

        long[] kRez = new long[N];
        for(int j = 0; j < kRez.length; j++){
            kRez[j] = 10000000;
        }
        for(int k = 0; k < tmp; k++){
            for(int i = 0; i < R; i++) {
                int[] arr1 = arr[i].clone();
                int key = k;
                long min = 0;
                min = measureTime(() -> new HybridMergeInsertion().hybridMergeInsertionSort(arr1, key));
                if(kRez[key] > min){
                    kRez[key] = min;
                }
            }
        }
        //System.out.println(Arrays.toString(kRez));
        long min = kRez[0];
        int bestK = 0;
        for(int k = 0; k<tmp; k++){
            if(kRez[k] < min){
                min = kRez[k];
                bestK=k;
            }
        }
        System.out.println("best k = " + bestK + " min = " + min);
    }


    public static void testTimeTask11(){

        int[] arr= InfoReader.inputArr();
        int N = arr.length;
        System.out.println(arr.length);
        long tmp = N;

        long[] kRez = new long[N];
        for(int j = 0; j < kRez.length; j++){
            kRez[j] = 10000000;
        }
        for(int k = 0; k < tmp; k++){
                int[] arr1 = arr.clone();
                int key = k;
                long min = 0;
                min = measureTime(() -> new HybridMergeInsertion().hybridMergeInsertionSort(arr1, key));
                if(kRez[key] > min){
                    kRez[key] = min;
            }
        }
        //System.out.println(Arrays.toString(kRez));
        System.out.println(Arrays.toString(kRez));
        long min = kRez[0];
        int bestK = 0;
        for(int k = 0; k<tmp; k++){
            if(kRez[k] < min){
                min = kRez[k];
                bestK=k;
            }
        }
        System.out.println("best k = " + bestK + " min = " + min);


        arr =  new HybridMergeInsertion().hybridMergeInsertionSort(arr, 1);
        System.out.println(Arrays.toString(arr));
    }



    public static void testTimeOfQuickSortVariations(){

        int size = 10000;
        int seed = 10000;
        int[] a = new int[size];
        int[] resultsForSortArrayA = a;
        a = QuickSort.createRandomArray(a, size, seed);
        System.out.println(Arrays.toString(a));
        int[] finalA = a;

        long timeOfTask = measureTime(()->QuickSort.quickSortSecondKey(finalA));
        System.out.println("Sort with second key: " + Arrays.toString(QuickSort.quickSortSecondKey(finalA)));
        System.out.println("Time: " + timeOfTask);

        timeOfTask = measureTime(()->QuickSort.quickSortMiddleKey(finalA));
        System.out.println("Sort with Middle key: " + Arrays.toString(QuickSort.quickSortMiddleKey(finalA)));
        System.out.println("Time: " + timeOfTask);

        timeOfTask = measureTime(()->QuickSort.quickSortRandomKey(finalA));  ;
        System.out.println("Sort with Random key: " + Arrays.toString(QuickSort.quickSortRandomKey(a)));
        System.out.println("Time: " + timeOfTask);

        timeOfTask = measureTime(()->QuickSort.quickSortMedianOfThreeKey(finalA));
        System.out.println("Sort with median three key: " + Arrays.toString(QuickSort.quickSortMedianOfThreeKey(a)));
        System.out.println("Time: " + timeOfTask);

        timeOfTask = measureTime(()-> QuickSort.quickSortHoar(finalA,0,finalA.length-1));;
        System.out.println("Sort with Hoar Partition: " + Arrays.toString( QuickSort.quickSortHoar(a,0,a.length-1)));
        System.out.println("Time: " + timeOfTask);

        timeOfTask = measureTime(()-> QuickSort.quickSortLomuto(finalA,0,finalA.length-1));
        System.out.println("Sort with Lomuto Partition: " + Arrays.toString(QuickSort.quickSortLomuto(a,0,a.length-1)));
        System.out.println("Time: " + timeOfTask);

    }


    private static long measureTime(Runnable task) {
        long startTime = System.currentTimeMillis();
        task.run();
        long elapsed = System.currentTimeMillis() - startTime;
        //System.out.println("Затраченное время: " + elapsed + " ms");
        return elapsed;
    }

}


